import React from 'react';
import '../styles/YachtCard.css';

const YachtCard = ({ image, title, description }) => {
  return (
    <div className="yacht-card">
      <img src={image} alt={title} />
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

export default YachtCard;
